import React from "react";
import { carouselItems } from "../../carouselDB";

export const Carousel = () => {
  return (
    <>
      {carouselItems?.map(({ id, name, image }) => (
        <div
          className="carousel"
          key={id}
          style={{
            width: "100vw",
            height: "100vh",
          }}
        >
          <img src={image} alt="" style={{ width: "90%", display: "block" }} />
        </div>
      ))}
    </>
  );
};
